properties.description:
Abbiamo il piacere di presentarvi in Via Padova 133 a pochi passi dal rinnovato Parco Trotter ed in prossimità dell’oramai gettonato e ricercato quartiere NoLo e delle metropolitane Loreto e Pasteur, zona in fase di piena rivalutazione grazie al “Progetto Via Padova”, all’interno di un contesto Vecchia Milano degli anni ’900, monolocale in fase di una completa ristrutturazione sito al terzo piano senza ascensore.
L’immobile è composto da: ingresso, ampia zona notte/giorno ed un bagno.
L’immobile gode di un’ottima luminosità favorita dal piano alto.Capitolato:
-Pompa di calore caldo/freddo;
-Piano cottura ad induzione;
-Serramenti in PVC doppio vetro a taglio termico;
Possibilità di cambiare il capitolato.
Riscaldamento autonomo.
Libero subito.I NOSTRI ORARI LAVORATIVI SONO DAL LUNEDÌ AL SA
